import React from "react";





const Future = () => {

  return (
    <Box
      sx={{
        mt: 8,
        mb: 12,
        p: 2,
        maxWidth: "1200px",
        mx: "auto",
      }}
      id="home"
    >

  <Grid container rowSpacing={0} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
  <Grid xs={6}>
    <List
sx = {{
 listStyleType: 'disc',
 pl: 2,
 '& .MuiListItem-root': {
